function drawMarker(i)
{
	if (i+1 > locs.length) return; //stop drawing markers if at end of locations array
	
	myDivUR.innerHTML = locs[i][1] + " " + locs[i][2].substr(0,5);
	
	for (var j = 0; j < markers.length; j++) //loop through displayed markers
	{
		var icon = markers[j].get('icon'); //get marker icon info
		icon.scale = icon.scale - 0.25; //reduce size
		markers[j].setIcon(icon); //apply icon to marker
	}
	
	var color;
	if (locs[i][0] == bears[0])
	{
		color = 'rgba(255, 0, 0, 1)'; //red
		data1.push(new google.maps.LatLng(locs[i][3],locs[i][4])); //add coordinates to heatmap
	}
	else if (locs[i][0] == bears[1])
	{
		color = 'rgba(0, 255, 0, 1)'; //green
		data2.push(new google.maps.LatLng(locs[i][3],locs[i][4])); //add coordinates to heatmap
	}
	else if (locs[i][0] == bears[2])
	{
		color = 'rgba(0, 0, 255, 1)'; //blue
		data3.push(new google.maps.LatLng(locs[i][3],locs[i][4])); //add coordinates to heatmap
	}
	else if (locs[i][0] == bears[3])
	{
		color = 'rgba(255, 255, 0, 1)'; //yellow
		data4.push(new google.maps.LatLng(locs[i][3],locs[i][4])); //add coordinates to heatmap
	}
	else if (locs[i][0] == bears[4])
	{
		color = 'rgba(0, 255, 255, 1)'; //teal
		data5.push(new google.maps.LatLng(locs[i][3],locs[i][4])); //add coordinates to heatmap
	}
	else if (locs[i][0] == bears[5])
	{
		color = 'rgba(255, 51, 255, 1)'; //pink
		data6.push(new google.maps.LatLng(locs[i][3],locs[i][4])); //add coordinates to heatmap
	}
	else if (locs[i][0] == bears[6])

	}
	else if (locs[i][0] == bears[7])

		data8.push(new google.maps.LatLng(locs[i][3],locs[i][4])); //add coordinates to heatmap
	}
	else if (locs[i][0] == bears[8])

		color = 'rgba(0, 153, 0, 1)'; //dark green
		data9.push(new google.maps.LatLng(locs[i][3],locs[i][4])); //add coordinates to heatmap
	}		
	var circle = { //set up icon
		path: google.maps.SymbolPath.CIRCLE,
		fillColor: color,
		fillOpacity: 1,
		scale: 5,
		strokeColor: "black",
		strokeWeight: 1
	}

	
	var marker = new google.maps.Marker({ //make marker          
		position: new google.maps.LatLng(locs[i][3],locs[i][4]),
		map: map,
		icon: circle,
		fillOpacity: 1,
		strokeOpacity: 1
		});

	markers.push(marker); //add marker to displayed markers array
	
	
	if (markers.length > 20) //check if some markers have been added
	{
		markers[0].setMap(null); //remove oldest marker from map
		markers.shift(); //remove oldest marker from displayed markers array
	}
	var t = setTimeout("drawMarker(" + (i+1) + ")", 25); //draw next marker after an amount of time
}
